import React from "react";
import { Box, useColorMode } from "@chakra-ui/core";

const Card = ({ children }) => {
  const { colorMode } = useColorMode();
  return (
    <Box
      bg={`mode.${colorMode}.card`}
      p={4}
      rounded="sm"
      gridArea="1 / 1 / 2 / 2"
      h="100%"
    >
      {children}
    </Box>
  );
};

export default Card;
